// eslint-disable-next-line import/no-anonymous-default-export
import shortid from "shortid"

export default {
    goods: [
        {
            id: shortid.generate(),
            title: 'potato',
            quantity: 1,
            isOver: false
        }
    ],
    get allGoods(){
        return this.goods.filter((item) => item.isOver)
    },
    create(){
        this.goods.push({
            title: '',
            quantity: 0,
            isOver: false
        })
    },
    deleteTodo(goodItem){
        this.goods.remove(goodItem)
    }
}
